PE html>\r","<html lang=\"en\">\r","    <head>\r","        <meta charset=\"utf-8\">\r","        <meta name=\"description\" content=\"EOI Confirmation\">\r","        <meta name=\"keywords\" content=\"HTML, CSS, JavaScript\">\r","        <meta name=\"author\" content=\"Erica Thompson\">\r","        <link rel=\"icon\" href=\"images/favicon.ico\">\r","        <link rel=\"stylesheet\" href=\"styles/style.css\">\r","        <title> EOI Confirmation</title>\r","    </head>\r","    <body>\r","        <h1>EOI Confirmation</h1>\r","        <?php\r","            if (!isset($_POST[\"jobRefNo\"])) header(\"location: apply.php\");\r","\r","            $STATE_CODES = array(\r","                \"VIC\" => [3,8],\r","                \"NSW\" => [1,2],\r","                \"QLD\" => [4,9],\r","                \"NT\" => [0,2],\r","                \"WA\" => [6],\r","                \"SA\" => [5],\r","                \"TAS\" => [7],\r","                \"ACT\" => [2]\r","            );\r","\r","            function sanitise_input($data) {\r","                $data = trim($data);\r","                $data = stripslashes($data);\r","                $data = htmlspecialchars($data);\r","                return $data;\r","            }\r","\r","            function filled_out($data) {\r","                return (isset($data) and !empty($data));\r","            }\r","\r","            require_once(\"settings.php\");\r","\r","            $conn = @mysqli_connect($host, $user, $pwd, $sql_db);\r","\r","            if (!$conn) {\r","                echo(\"<p>Database connection failure!</p>\");\r","            } else {\r","                $sql_table = \"eoi\";\r","                $valid_input = true;\r","\r","                //Error message if any required fields are missing:\r","                if (!(filled_out($_POST[\"jobRefNo\"]) \r","                    and filled_out($_POST[\"firstname\"]) \r","                    and filled_out($_POST[\"lastname\"]) \r","                    and filled_out($_POST[\"dob\"]) \r","                    and filled_out($_POST[\"gender\"]) \r","                    and filled_out($_POST[\"streetAddress\"]) \r","                    and filled_out($_POST[\"suburb\"]) \r","                    and filled_out($_POST[\"state\"]) \r","                    and filled_out($_POST[\"postcode\"]) \r","                    and filled_out($_POST[\"email\"]) \r","                    and filled_out($_POST[\"phone\"]))){\r","                    echo \"<p style=\\\"color: red;\\\">Required field(s) have not been filled out!</p>\";\r","                    $valid_input = false;\r","                } else {\r","                    //Set variables from $_POST.\r","                    //Fields with limited options don't have to be sanitised.\r","                    if (filled_out($_POST[\"jobRefNo\"])) $jobRefNo = sanitise_input($_POST[\"jobRefNo\"]);\r","                    if (filled_out($_POST[\"firstname\"])) $firstname = sanitise_input($_POST[\"firstname\"]);\r","                    if (filled_out($_POST[\"lastname\"])) $lastname = sanitise_input($_POST[\"lastname\"]);\r","                    if (filled_out($_POST[\"dob\"])) $dob = $_POST[\"dob\"];\r","                    if (filled_out($_POST[\"gender\"])) $gender = $_POST[\"gender\"];\r","                    if (filled_out($_POST[\"streetAddress\"])) $streetAddress = sanitise_input($_POST[\"streetAddress\"]);\r","                    if (filled_out($_POST[\"suburb\"])) $suburb = sanitise_input($_POST[\"suburb\"]);\r","                    if (filled_out($_POST[\"state\"])) $state = $_POST[\"state\"];\r","                    if (filled_out($_POST[\"postcode\"])) $postcode = sanitise_input($_POST[\"postcode\"]);\r","                    if (filled_out($_POST[\"email\"])) $email = sanitise_input($_POST[\"email\"]);\r","                    if (filled_out($_POST[\"phone\"])) $phone = sanitise_input($_POST[\"phone\"]);\r","                    $skills = Array();\r","                    if (isset($_POST[\"skills\"])) $skills = $_POST[\"skills\"];\r","                    if (isset($_POST[\"otherText\"])) $otherText = sanitise_input($_POST[\"otherText\"]);\r","\r","\r","                    //Specific value validation:\r","                    if (!is_numeric($jobRefNo) or !(0 <= $jobRefNo and $jobRefNo <= 99999) or (strlen($jobRefNo) != 5)) $valid_input = false;                           //Validate job reference number\r","                    if ((strlen($firstname) > 20) or !preg_match(\"/^[a-zA-Z]*$/\", $firstname)) $valid_input = false;                                                    //Validate firstname\r","                    if ((strlen($lastname) > 20) or !preg_match(\"/^[a-zA-Z\\-]*$/\", $lastname)) $valid_input = false;                                                    //Validate lastname\r","                    $date = new DateTime($dob);\r","                    $now = new DateTime();\r","                    $age_interval = $now->diff($date);\r","                    if (!(15 <= $age_interval->y and $age_interval->y <= 80)) $valid_input = false;                                                                     //Validate date of birth gives an age between 15 and 80\r","                    if (strlen($streetAddress) > 40) $valid_input = false;                                                                                              //Validate street address\r","                    if (strlen($suburb) > 40) $valid_input = false;                                                                                                     //Validate suburb\r","                    if (strlen($postcode) != 4 or !is_numeric($postcode)) {                                                                                             //Validate postcode\r","                        $valid_input = false; \r","                    } else if (!in_array($postcode[0], $STATE_CODES[$state])) {\r","                        $valid_input = false;\r","                    }\r","                    if (strlen($email) > 128 or !preg_match(\"/^[a-zA-Z0-9.!#$%&'*+\\/=?^_`{|}~-]+@[a-zA-Z0-9-]+(?:\\.[a-zA-Z0-9-]+)*$/\", $email)) $valid_input = false;   //Validate email address matches correct format\r","                    $compressed_phone = str_replace(\" \", \"\", $phone);\r","                    if (!(8 <= strlen($compressed_phone) and strlen($compressed_phone) <= 12) or strlen($phone) > 16) $valid_input = false;                             //Validate phone number (also rejects if over 16 chars as this is all the database can handle)\r","                    if (in_array(\"Other Skills\", $skills) and empty($otherText)) $valid_input = false;                                                                  //Validate that other skills textbox is filled out if \"Other Skills\" checkbox is ticked.\r","\r","                    if(!$valid_input) echo \"<p style=\\\"color: red\\\">Sorry, some of the data you entered was invalid!</p>\";\r","                }\r","\r","                //Database interactions\r","                if ($valid_input) {\r","                    //Check for EOI table and make it if not present.\r","                    $query = \"SHOW TABLES\";\r","                    $result = mysqli_query($conn, $query);\r","                    $found_table = false;\r","\r","                    while ($row = mysqli_fetch_assoc($result)) {\r","                        if ($sql_table == array_values($row)[0]) $found_table = true;\r","                    }\r","\r","                    mysqli_free_result($result);\r","                    if (!$found_table) {\r","                        $query = \"CREATE TABLE eoi (\r","                            EOInumber INT NOT NULL AUTO_INCREMENT PRIMARY KEY,\r","                            jobRef MEDIUMINT NOT NULL,\r","                            firstname VARCHAR(20) NOT NULL,\r","                            lastname VARCHAR(20) NOT NULL,\r","                            dob DATE NOT NULL, \r","                            gender VARCHAR(64) NOT NULL,\r","                            streetAddress VARCHAR(40) NOT NULL,\r","                            suburb VARCHAR(40) NOT NULL,\r","                            state ENUM('VIC', 'NSW', 'QLD', 'NT', 'WA', 'SA', 'TAS', 'ACT') NOT NULL,\r","                            postcode CHAR(4) NOT NULL,\r","                            email VARCHAR(128) NOT NULL,\r","                            phone VARCHAR(16) NOT NULL,\r","                            skills TEXT,\r","                            otherSkills TEXT,\r","                            status ENUM('New', 'Current', 'Final') NOT NULL\r","                            )\";\r","                        mysqli_query($conn, $query);\r","                        echo \"<p>made new table</p>\";\r","                    }\r","\r","                    $skills_string = implode(\",\", $skills);\r","                    $query = \"INSERT INTO eoi \r","                                (jobRef, firstname, lastname, dob, gender, streetaddress, suburb, state, postcode, email, phone, skills, otherSkills)\r","                                    VALUES\r","                                ($jobRefNo, \\\"$firstname\\\", \\\"$lastname\\\", \\\"$dob\\\", \\\"$gender\\\", \\\"$streetAddress\\\", \\\"$suburb\\\", \\\"$state\\\", \\\"$postcode\\\", \\\"$email\\\", \\\"$phone\\\", \\\"$skills_string\\\", \\\"$otherText\\\")\";\r","\r","                    $result = mysqli_query($conn, $query);\r","\r","                    if (!$result) {\r","                        echo \"<p style:\\\"color: red\\\">Sorry, something went wrong!</p>\";\r","                    } else {\r","                        $get_id = mysqli_insert_id($conn);\r","                        echo \"<p style:\\\"color: green\\\">Your expression of interest has been received! 🙂</p><p><strong>Your EOI ID is: </strong>$get_id</p>\";\r","                    }\r","\r","                }\r","\r","                mysqli_close($conn);\r","            }\r","    